import React, { useState } from 'react';

export default function Home() {
    const services = [
        { title: 'Design UX/UI', image: 'https://via.placeholder.com/200x120', description: 'Conception d’interfaces élégantes et efficaces.' },
        { title: 'Site Vitrine', image: 'https://via.placeholder.com/200x120', description: 'Création de sites web modernes et réactifs.' },
        { title: 'Identité Visuelle', image: 'https://via.placeholder.com/200x120', description: 'Création de logos, chartes graphiques, branding.' },
    ];

    const projects = [
        { title: 'Projet Alpha', image: 'https://via.placeholder.com/240x140', description: 'Refonte complète d’une identité web pour une startup.' },
        { title: 'Projet Beta', image: 'https://via.placeholder.com/240x140', description: 'Site e-commerce full responsive.' },
        { title: 'Projet Gamma', image: 'https://via.placeholder.com/240x140', description: 'Application mobile avec design sur-mesure.' },
    ];

    const [flipped, setFlipped] = useState({});

    const toggleFlip = (index, type) => {
        setFlipped((prev) => ({
            ...prev,
            [`${type}-${index}`]: !prev[`${type}-${index}`],
        }));
    };

    return (
        <div className="font-sans text-gray-800 bg-gradient-to-b from-white to-gray-100">
            {/* Header */}
            <header className="flex items-center justify-between p-6 shadow-md bg-white fixed top-0 left-0 right-0 z-50">
                <div className="text-2xl font-bold text-indigo-600">Trente</div>
                <nav className="space-x-4">
                    {['Accueil', 'Services', 'Projets', 'Contact'].map((item) => (
                        <button
                            key={item}
                            className="px-4 py-2 bg-white rounded-lg shadow-md hover:translate-y-[-2px] hover:shadow-xl transition-transform duration-300 border"
                        >
                            {item}
                        </button>
                    ))}
                </nav>
            </header>

            {/* Hero */}
            <section className="pt-32 px-6 md:px-20 text-center md:text-left flex flex-col md:flex-row items-center justify-between min-h-screen bg-white">
                <div className="max-w-xl space-y-6">
                    <p className="text-sm text-gray-500">Athos 2.0 – Portfolio Template</p>
                    <h1 className="text-4xl font-extrabold text-gray-800 leading-tight">
                        Votre Partenaire Stratégique pour des Solutions Digitales
                    </h1>
                    <p className="text-gray-600">
                        Accompagnement des startups et marques pour concevoir des expériences numériques uniques.
                    </p>
                    <div className="space-x-4">
                        <button className="px-5 py-2 bg-black text-white rounded-full shadow-md hover:bg-gray-800 transition">Remix Template</button>
                        <button className="px-5 py-2 bg-white border border-gray-300 rounded-full shadow-md hover:bg-gray-100 transition">Dark Mode</button>
                    </div>
                    <div className="pt-10 flex space-x-4 justify-center md:justify-start">
                        {['https://via.placeholder.com/40', 'https://via.placeholder.com/40', 'https://via.placeholder.com/40'].map((icon, i) => (
                            <img key={i} src={icon} alt="icon" className="w-10 h-10 rounded-full shadow-md" />
                        ))}
                    </div>
                </div>
                <div className="w-72 h-72 rounded-full bg-yellow-200 shadow-inner opacity-90"></div>
            </section>

            {/* Services */}
            <section id="services" className="py-24 px-6 md:px-20 bg-gray-50">
                <h2 className="text-3xl font-bold mb-10 text-center">Nos Services</h2>
                <div className="flex flex-row flex-wrap justify-center gap-10">
                    {services.map((service, index) => (
                        <div
                            key={index}
                            onClick={() => toggleFlip(index, 'service')}
                            className={`w-64 h-80 perspective cursor-pointer relative`}
                            style={{ transform: `translateY(${(index % 2) * 20}px)` }}
                        >
                            <div className={`transition-transform duration-700 transform-style-preserve-3d w-full h-full ${flipped[`service-${index}`] ? 'rotate-y-180' : ''}`}>
                                <div className="absolute w-full h-full backface-hidden bg-white shadow-xl rounded-xl flex flex-col items-center justify-center p-4">
                                    <img src={service.image} alt={service.title} className="w-full h-32 object-cover rounded-md mb-4" />
                                    <h3 className="text-xl font-semibold">{service.title}</h3>
                                </div>
                                <div className="absolute w-full h-full backface-hidden rotate-y-180 bg-indigo-100 rounded-xl p-6 text-center flex items-center justify-center">
                                    <p>{service.description}</p>
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            </section>

            {/* Projects */}
            <section id="projets" className="py-24 px-6 md:px-20 bg-white">
                <h2 className="text-3xl font-bold mb-10 text-center">Nos Réalisations</h2>
                <div className="flex flex-row gap-10 justify-center flex-wrap">
                    {projects.map((project, index) => (
                        <div
                            key={index}
                            onClick={() => toggleFlip(index, 'project')}
                            className="w-64 h-64 perspective cursor-pointer relative"
                        >
                            <div className={`transition-transform duration-700 transform-style-preserve-3d w-full h-full ${flipped[`project-${index}`] ? 'rotate-y-180' : ''}`}>
                                <div className="absolute w-full h-full backface-hidden bg-white shadow-xl rounded-xl flex flex-col items-center justify-center p-4">
                                    <img src={project.image} alt={project.title} className="w-full h-32 object-cover rounded-md mb-4" />
                                    <h3 className="text-xl font-semibold">{project.title}</h3>
                                </div>
                                <div className="absolute w-full h-full backface-hidden rotate-y-180 bg-indigo-100 rounded-xl p-6 text-center flex items-center justify-center">
                                    <p>{project.description}</p>
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            </section>

            {/* Footer */}
            <footer className="bg-gray-100 text-center text-sm py-6 border-t mt-10">
                © {new Date().getFullYear()} Trente. Tous droits réservés.
            </footer>

            {/* Style fixes for 3D */}
            <style>{`
        .perspective {
          perspective: 1000px;
        }
        .transform-style-preserve-3d {
          transform-style: preserve-3d;
        }
        .backface-hidden {
          backface-visibility: hidden;
        }
        .rotate-y-180 {
          transform: rotateY(180deg);
        }
      `}</style>
        </div>
    );
}
